	function ulangCss($listCss)
	{
		$style = null;
		if (isset($listCss) && $listCss != null)
		{
			foreach ($listCss as $css)
			{
				$style .= "\n" . '<link rel="stylesheet" type="text/css" href="' . $css . '">';
			}
		}

		return $style;
	}
